import { ConstructorElement } from "@ya.praktikum/react-developer-burger-ui-components";
import products from "../../../utils/data";


const Rest = () => {

const burgerconstructor = products.map(function (itemBurger) {
  return (
    <section>
      <img src={itemBurger.image_mobile} />
      <p>{itemBurger.name}</p>
      <p>{itemBurger.price}</p>
    </section>
  );
});

  return (

      
 <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
      {products.map((itemBurger, index) => (
        <ConstructorElement
          key={index}
          text={itemBurger.name}
          price={itemBurger.price}
          thumbnail={itemBurger.image_mobile}
        />
      ))}   

    </div>
  );
};
export default Rest;
